import React from "react";

const Home = () => {

  const [dict, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000");
      const jsonData = await response.json();
      setDict(jsonData);
    } catch (err) {
      console.error(err.message);
    }
  };


  return (
    <div>
      <h1>HOME</h1>
      <div>Have some content</div>
    </div>
  );
};

export default Home;
